import {useState} from 'react';
import './style.css'

const Navbar = () => {
    let Links = [
        { name: 'Home', link: '/' },
        { name: 'About', link: '/' },
        { name: 'Contact', link: '/' },
        { name: 'Project', link: '/' },
        { name: 'Project', link: '/' }
    ]
    let [open , setOpen] = useState(false);
    return (
        <div className='w-screen h-[80px] z-10 bg-color-primary fixe'>

        </div>
    )
}

export default Navbar;
